import React from "react";
import ReactDOM from "react-dom/client";

class Root extends React.Component {
	render () {
		return (
			<h1>
				Here
			</h1>
		);
	}
}

<link rel="icon" href="./icon.svg" type="image/svg+xml" />
const root = ReactDOM.createRoot (document.getElementById ("root"));
root.render (<Root />);
